import React, { Fragment } from "react";
import { HeartTwoTone } from "@ant-design/icons";
import { Link } from "react-router-dom";
import "./About.css";

function about() {
  return (
    <Fragment>
      <div className="Post">
        <h1>About this Project!</h1>
        <div className="para">
          This Project is about Comparing Github Profile's by usernames and get
          to know the scores based on number of followers , Number of
          repositories
        </div>

        <Link to="/compare">
          <button className="ButDesign">Let's Compare</button>
        </Link>

        <p className="para2">
          Made By Aditya Choudhari with antd
          <HeartTwoTone twoToneColor="#eb2f95" />
        </p>
      </div>
    </Fragment>
  );
}
export default about;
